  loader.load().then(() => {
    console.log("Maps JS API loaded");
    const map = displayMap(); //Line 19
    const markers = addMarkers(map); //Line 29
    // clusterMarkers(map, markers); //Envokes line 60
    // addPanToMarker(map, markers); //Envokes line 65
  });

  const mapOptions = {
    center: { lat: 43.838413, lng: -79.086761 },
    zoom: 14,
  };
  const mapDiv = document.getElementById("map");
  const map = new google.maps.Map(mapDiv, mapOptions);
  return map;
}

export default displayMap;
